import { createRouter, createWebHistory } from "vue-router";
import createAccount from "./components/createAccount.vue";

const routes = [
  {
    name: "createAccount",
    path: "/createAccount",
    component: createAccount,
  },
];
const router = createRouter({
  history: createWebHistory(),
  routes,
});
export default router;
